import React from 'react'
import { useSelector } from 'react-redux';

const CartPage = () => {
  // const [tatalItem,setTatalItem] = useState
  const tatalItem = useSelector((state) => state.cart.itemCount );
  const tatalAmount = useSelector((state) => state.cart.totalAmount );

  return (
    <div>
      {tatalItem}
      <div>{tatalAmount}</div>
    </div>
  )
}

export default CartPage;
